// SahihBukhaary.js
import React from 'react';

const SahihBukhaary = () => {
    return (
        <div>
            {/* Content for Sahih Bukhaary page */}
            <h1>Sahih Bukhaary</h1>
            <h2>Download Audio Files:</h2>
            <ul>
                <li>
                    <a href="/path/to/audio1.mp3" download>Audio File 1</a>
                </li>
                <li>
                    <a href="/path/to/audio2.mp3" download>Audio File 2</a>
                </li>
                {/* Add more audio files as needed */}
            </ul>
        </div>
    );
}

export default SahihBukhaary;
